@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css']
})
export class HeaderComponent {

}
<header>
    <div class="container">
        <a href="#" routerLink="/" class="logo">TC @ Food Corner!</a>
        <nav>
            <ul>
                <li>
                    <a href="#">Cart</a>
                </li>
            </ul>

        </nav>
    </div>
</header>
